import React from 'react';
import { useNavigate } from 'react-router-dom';
import './MainTabs.css';

function MainTabs() {
    const navigate = useNavigate();

    return (
        <div className="tabs-container">
            <button onClick={() => navigate('/comprehensive-analysis')}>종합 분석</button>
            <button onClick={() => navigate('/technical-analysis')}>테크니컬 분석</button>
            <button onClick={() => navigate('/indicator-analysis')}>지표 분석</button>
        </div>
    );
}

export default MainTabs;
